import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));
const value1 = 'Yes';
const fname = 'Nafees';
const lname = 'Ahmad';
root.render(
  <>
  <h1>Welcome to Rect JS</h1>
  <h1>{`Welcome to Rect JS ans ${fname} ${lname}`}</h1>
  <p>From Nafees Ahmad</p>
  <p>5+5 + {5+5} and varibale = {value1}</p>
  </>
);
